import "./styles.css";
import { get } from "./axios";
import React, { useState, useEffect } from "react";
import Table from "./table";
export default function App() {
  const [songs, setReleases] = useState([]);

  useEffect(() => {
    get("artists/1/releases", "page=2&per_page=75").then((response) => {
      const {
        data: { releases },
      } = response;
      setReleases(releases);
    });
  }, []);
  return (
    <div className="App">
      <Table releasesData={releases}></Table>
    </div>
  );
}
